import React from "react";

import addButton from "./../images/add.svg";
import ItemContainer from "./itemcontainer.js"

const PAGES = { homepage: "homepage", notebook: "notebook" };

function List({ setCurrentScreen }) {
  return (
    <div className="list-container">
      <div className="list-header">
        <h1>Notebooks</h1>
        <img
          className="add-button"
          src={addButton}
          alt="Add Button"
          onClick={() => setCurrentScreen(PAGES.notebook)}
        ></img>
      </div>
      <ItemContainer />
      <ItemContainer />
      <ItemContainer />
      <ItemContainer />
      <ItemContainer />
      <ItemContainer />
    </div>
  );
}

export default List;
